import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
    search: {
        display: 'flex',
        justifyContent: 'center',
        
    },
    input: {
        border: '3px solid #252C6F',
        borderRadius: '4px',
        padding: '2px',
        background: '#D4EBEE',
        focus: 'none',
        width: '300px',
        justifyContent: 'center',
    },
    results: {

    },
    icon: {
        height: ' 60px',
        width: '50px',
        background: ' white',
        display: 'grid',
        placeItems: 'center',
        display: 'flex',
    },
    
    iconSvg: {
        fontSize: '35px',
    }
})) ;
